import './App.css';
// 1. Importe o Link, Routes e Route
import { Routes, Route, Link } from 'react-router-dom';

// --- Criei páginas de exemplo que você pode colocar em arquivos separados ---
// (Você pode criar uma pasta "pages" e mover cada função dessa para lá)

function Home() {
    return (
        <div className="content-section">
            <h1 className="display-4 mb-4">Bem vindo!</h1>
            <p className="lead text-muted">Desbravando um pouco de Java e React</p>
            <div className="button-group">
                {/* 2. Links do React Router são usados para navegar sem recarregar a página */}
                <Link to="/produtos" className="btn btn-custom">Ver Produtos</Link>
                <Link to="/usuarios" className="btn btn-custom">Ver Usuarios</Link>
            </div>
        </div>
    );
}

function ProductList() {
    return <h1 className="display-4 mb-4">Página de Produtos</h1>;
    // TODO: Aqui você vai usar o Axios para buscar dados do seu backend Spring
}

function UserList() {
    return <h1 className="display-4 mb-4">Página de Usuários</h1>;
    // TODO: Aqui você vai usar o Axios para buscar dados do seu backend Spring
}
// --- Fim das páginas de exemplo ---


function App() {
    return (
        // 3. Removemos a tag <body>. A div principal é o suficiente.
        <div className="Container">

            {/* Navbar Principal */}
            <nav className="navbar navbar-expand-lg">
                <div className="container-fluid">
                    {/* 4. Usamos <Link> no lugar de <a> para navegação interna */}
                    <Link className="navbar-brand" to="/">Basic System</Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#topNavbar"
                            aria-controls="topNavbar" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="topNavbar">
                    </div>
                </div>
            </nav>

            {/* Navbar Secundária (Opções) */}
            <nav className="navbar-opcoes navbar-expand-lg">
                <div className="container-fluid">
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav"
                            aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle sub-navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav">
                            <li className="nav-item">
                                <Link className="nav-link" to="/produtos">Lista de Produto</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/usuarios">Lista de Usuarios</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

            {/* Conteúdo Principal (onde as páginas mudam) */}
            <div className="container">
                {/* 5. O <Routes> define qual componente (página) deve aparecer
             baseado na URL que o <Link> mudou.
        */}
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/produtos" element={<ProductList />} />
                    <Route path="/usuarios" element={<UserList />} />
                </Routes>
            </div>

            {/* 6. Removemos as tags <script> daqui. Elas já estão no index.html */}
        </div>
    );
}

export default App;
